pub enum ResolveError {

    #[error("Invalid index into array")]
    InvalidAccessIndex,

    #[error("Function {name} not defined")]
    FunctionNotDefined {
        name: String,
    },

    #[error("Function without return type")]
    FunctionReturnsVoid,
}

pub enum VectorSize {

    /// 2D vector
    Bi = ,

    /// 3D vector
    Tri = ,

    /// 4D vector
    Quad = ,
}

pub enum ScalarKind {

    /// Signed integer type.
    Sint,

    /// Unsigned integer type.
    Uint,

    /// Floating point type.
    Float,

    /// Boolean type.
    Bool,
}

pub enum ArraySize {

    /// The array size is known at compilation.
    Static(u32),

    /// The array size can change at runtime.
    Dynamic,
}

pub enum MemberOrigin {

    /// Built-in shader variable.
    BuiltIn(BuiltIn),

    /// Offset within the struct.
    Offset(u32),
}

pub enum ImageDimension {

    /// 1D image
    D1,

    /// 2D image
    D2,

    /// 3D image
    D3,

    /// Cube map
    Cube,
}

pub enum TypeInner {

    /// Number of integral or floating-point kind.
    Scalar {
        kind: ScalarKind,
        width: Bytes,
    },

    /// Vector of numbers.
    Vector {
        size: VectorSize,
        kind: ScalarKind,
        width: Bytes,
    },

    /// Matrix of numbers.
    Matrix {
        columns: VectorSize,
        rows: VectorSize,
        kind: ScalarKind,
        width: Bytes,
    },

    /// Pointer to a value.
    Pointer {
        base: Handle<Type>,
        class: StorageClass,
    },

    /// Homogenous list of elements.
    Array {
        base: Handle<Type>,
        size: ArraySize,
        stride: Option<NonZeroU32>,
    },

    /// User-defined structure.
    Struct {
        members: Vec<StructMember>,
    },

    /// Possibly multidimensional array of texels.
    Image {
        base: Handle<Type>,
        dim: ImageDimension,
        flags: ImageFlags,
    },

    /// Depth-comparison image.
    DepthImage {
        dim: ImageDimension,
        arrayed: bool,
    },

    /// Can be used to sample values from images.
    Sampler {
        comparison: bool,
    },
}

pub enum Binding {

    /// Built-in shader variable.
    BuiltIn(BuiltIn),

    /// Indexed location.
    Location(u32),

    /// Binding within a descriptor set.
    Descriptor {
        set: u32,
        binding: u32,
    },
}

pub enum Expression {

    /// Array access with a computed index.
    Access {
        base: Handle<Expression>,
        index: Handle<Expression>,
    },

    /// Array access with a known index.
    AccessIndex {
        base: Handle<Expression>,
        index: u32,
    },

    /// Constant value.
    Constant(Handle<Constant>),

    /// Composite expression.
    Compose {
        ty: Handle<Type>,
        components: Vec<Handle<Expression>>,
    },

    /// Reference a function parameter, by its index.
    FunctionParameter(u32),

    /// Reference a global variable.
    GlobalVariable(Handle<GlobalVariable>),

    /// Reference a local variable.
    LocalVariable(Handle<LocalVariable>),

    /// Load a value indirectly.
    Load {
        pointer: Handle<Expression>,
    },

    /// Sample a point from an image.
    ImageSample {
        image: Handle<Expression>,
        sampler: Handle<Expression>,
        coordinate: Handle<Expression>,
        depth_ref: Option<Handle<Expression>>,
    },

    /// Apply an unary operator.
    Unary {
        op: UnaryOperator,
        expr: Handle<Expression>,
    },

    /// Apply a binary operator.
    Binary {
        op: BinaryOperator,
        left: Handle<Expression>,
        right: Handle<Expression>,
    },

    /// Call an intrinsic function.
    Intrinsic {
        fun: IntrinsicFunction,
        argument: Handle<Expression>,
    },

    /// Dot product between two vectors.
    DotProduct(Handle<Expression>, Handle<Expression>),

    /// Cross product between two vectors.
    CrossProduct(Handle<Expression>, Handle<Expression>),

    /// Compute the derivative on an axis.
    Derivative {
        axis: DerivativeAxis,
        expr: Handle<Expression>,
    },

    /// Call another function.
    Call {
        origin: FunctionOrigin,
        arguments: Vec<Handle<Expression>>,
    },
}

pub enum Statement {

    /// Empty statement, does nothing.
    Empty,

    /// A block containing more statements, to be executed sequentially.
    Block(Block),

    /// Conditionally executes one of two blocks, based on the value of the condition.
    If {
        condition: Handle<Expression>,
        accept: Block,
        reject: Block,
    },

    /// Conditionally executes one of multiple blocks, based on the value of the selector.
    Switch {
        selector: Handle<Expression>,
        cases: FastHashMap<i32, (Block, Option<FallThrough>)>,
        default: Block,
    },

    /// Executes a block repeatedly.
    Loop {
        body: Block,
        continuing: Block,
    },

    /// Exits the loop.
    Break,

    /// Skips execution to the next iteration of the loop.
    Continue,

    /// Returns from the function (possibly with a value).
    Return {
        value: Option<Handle<Expression>>,
    },

    /// Aborts the current shader execution.
    Kill,

    /// Stores a value at an address.
    Store {
        pointer: Handle<Expression>,
        value: Handle<Expression>,
    },
}
